    require('splash-screen/splash.min.css').use();
    require('splash-screen').enable('circular');
});

require.ensure(['sass/styles.scss', 'splash-screen', './main'], function(require) {

	require('sass/styles.scss');

    var App = require('./main').default;
    (new App()).run();
});

